  "text" : "\uBB3C\uB860 \uD3B8\uC9D1\uB41C \"\uBCF4\uD3B8\uC801\uC778 \uC0C1\uC2DD\uC5D0\uC11C \uBC97\uC5B4\uB098\uC9C0 \uC54A\uB098. \uC801\uC815 \uAC00\uACA9\uC73C\uB85C \uB3FC\uC57C \uD55C\uB2E4\" \uB77C\uB294 \uBC1C\uC5B8\uB9CC \uAC00\uC9C0\uACE0\uB3C4 \uC648\uAC00\uC648\uBD80 \uD560 \uC5EC\uC9C0\uAC00 \uC788\uAE34 \uD558\uB098.. '\uAD70\uB0A9\uBE44\uB9AC\uAC00 \uB9CC\uC5F0\uD574 \uC788\uB2E4\uB294 \uAC83\uC774 \uBCF4\uD3B8\uC801 \uC0C1\uC2DD\uC774\uB2E4' \uB77C\uACE0 \uC0DD\uAC01\uD558\uACE0 \uC811\uADFC\uD55C\uB2E4\uBA74, \uAF2D \uBE44\uB09C\uB9CC \uBC1B\uC544\uC57C \uD560 \uBC1C\uC5B8 \uAC19\uC9C0\uB294 \uC54A\uC74C..",
