  "text" : "GOP\uB294 \uC544\uB2C8\uC9C0\uB9CC, \uC800\uB3C4 \uD480 \uBC14\uB514\uC544\uBA38\uB97C \uCC29\uC6A9\uD55C \uCC44 \uC0B0\uC744 \uBA87 \uBC88 \uC62C\uB77C\uBD24\uC2B5\uB2C8\uB2E4. \uB098\uB984 \uD560\uB9CC \uD588\uC5B4\uC694. \uBC29\uD0C4\uBCF5\uACFC \uBB34\uAE30, \uC7A5\uAD6C\uB958\uC758 \uBB34\uAE30\uB294 \uC0DD\uBA85\uC758 \uBB34\uAC8C\uC774\uACE0, \uADF8 \uBB34\uAC8C\uB97C \uACAC\uB514\uAE30 \uC704\uD574 \uD3C9\uC18C\uC5D0 \uAE30\uCD08\uCCB4\uB825\uACFC \uADFC\uB825\uC744 \uAE30\uB978 \uAC83\uC774\uB2C8\uAE4C\uC694 http:\/\/t.co\/X3ywRdvokG",
