  "text" : "\uC194\uC9C1\uD788 \uC774\uB7F0 \uBAA8\uC2B5\uB4E4\uC774 \uC6B0\uB9AC\uAC00 \uC8FC\uBCC0\uC5D0\uC11C \uD754\uD788 \uBCFC \uC218 \uC788\uB294 \uBAA8\uC2B5\uC778 \uAC83 \uAC19\uC74C. \uBBF8\uD761\uD55C \uC548\uC804\uB300\uCC45\uC774\uB098 \uAD00\uB9AC\uC18C\uD640 \uB4F1\uC73C\uB85C \uC778\uD574 \uD654\uC7AC\uC758 \uD76C\uC0DD\uC790\uAC00 \uBC1C\uC0DD\uD55C \uAC83\uC5D0 \uB300\uD574 \uB2F5\uB2F5\uD558\uACE0 \uBD84\uB178\uD558\uB294 \uB9C8\uC74C\uC5D0 \uB2F4\uBC30\uB97C \uD0DC\uC6B0\uACE0\uC120 \uC778\uD654\uBB3C \uAC00\uB4DD\uD55C \uC4F0\uB808\uAE30\uD1B5 \uB4F1\uC5D0 \uAF41\uCD08\uB97C \uB358\uC838\uB123\uB294\uB2E4\uB358\uAC00 \uD558\uB294..",
