  "text" : "\uC800\uB7F0 \uB188\uB4E4 \uC2F9 \uB2E4 \uC7A1\uC544 \uC8FD\uC5EC\uC57C \uD55C\uB2E4\uBA70 \uC790\uAE30\uB4E4\uB07C\uB9AC \uD070 \uC18C\uB9AC\uB85C \uBD84\uB178\uD558\uAE30 \uC2DC\uC791. \uC548\uC804\uC218\uCE59\uC774 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uBD84\uB178\uAC00 \uD3ED\uBC1C\uD558\uB2C8 \uC695\uC774 \uB298\uACE0, \uC74C\uC8FC\uB7C9\uB3C4 \uC790\uAFB8\uB9CC \uB298\uACE0..\n\n\uC5BC\uAD74\uC774 \uC2DC\uBED8\uAC1C\uC9C4 \uBC29\uBC94\uB300\uC6D0\uBD84\uB4E4\uC774 \uACC4\uC0B0\uC744 \uB9C8\uCE58\uACE0\uB294 \uBC29\uBC94\uCC28\uB7C9\uC744 \uC6B4\uC804\uD558\uACE0 \uAC00\uC2DC\uAE38\uB798 \uACE7\uBC14\uB85C \uACBD\uCC30\uC5D0 \uC2E0\uACE0.",
