    "text" : "2014\uB144 \uD034\uC5B4\uBB38\uD654\uCD95\uC81C @kqcf \uAC00 6\uC6D4 7\uC77C \uC2E0\uCD0C\uC5D0\uC11C \uC5F4\uB9BD\uB2C8\uB2E4. \uC8FC\uD55C\uBBF8\uAD6D\uB300\uC0AC\uAD00 \uBD80\uC2A4\uB3C4 \uB9C8\uB828\uB418\uC5B4 \uC788\uC73C\uB2C8 \uC624\uD6C4 3 - 7\uC2DC \uC0AC\uC774\uC5D0 \uB9CE\uC774\uB4E4 \uBC29\uBB38\uD574 \uC8FC\uC138\uC694. \uC7AC\uBC0C\uB294 \uAC8C\uC784\uACFC \uC2A4\uB0B5, \uC0C1\uD488\uC774 \uC900\uBE44\uB418\uC5B4 \uC788\uB2F5\uB2C8\uB2E4! http:\/\/t.co\/qqDHsQkEIs",
