  "text" : "\uC545\uC218 \uAC70\uBD80\uD589\uC704\uB294 \uBCF8\uC778\uC758 \uC815\uCE58\uC801 \uC758\uC0AC \uD45C\uBA85\uC774\uB098 \uC2E0\uB150\uC5D0 \uB530\uB978 \uD589\uB3D9\uC774\uAE30\uC5D0, \uADF8\uC5D0 \uB300\uD574\uC120 \uBB50\uB77C \uD3C9\uD558\uACE0 \uC790\uC2DC\uACE0 \uD560 \uAC83\uB3C4 \uC5C6\uACE0, \uADF8\uB7F4 \uC774\uC720\uB3C4 \uC5C6\uC74C.\n\n\uB2E4\uB9CC, '\uACA8\uC6B0 \uADF8\uC815\uB3C4\uB85C \uB9C8\uC74C\uC774 \uC654\uB2E4\uAC14\uB2E4 \uD560 \uC0AC\uB78C\uB4E4\uC774 \uC788\uACA0\uB0D0?' \uB77C\uB294 \uB9D0\uC5D0\uB294 '\uC788\uB354\uB77C\uAD6C\uC694.' \uB77C\uACE0 \uB9D0\uD574\uC8FC\uACE0 \uC2F6\uB124\uC694",
