  "text" : "\uC774\uB7EC\uD55C \uC0AC\uD68C\uC801 \uACF5\uD3EC\uB294 \uB2E4\uC2DC \uB2E4\uC74C\uACFC \uAC19\uC740 2\uAC00\uC9C0\uC758 \uD6A8\uACFC\uB97C \uB0B3\uAC8C \uB41C\uB2E4\uACE0 \uD55C\uB2E4. \uC6B0\uC120 \uBC94\uC8C4\uC790\uB4E4\uC744 \uB0AF\uC775\uC740 \uC2A4\uD14C\uB808\uC624 \uD0C0\uC785\uC758 \uC601\uC5ED\uC73C\uB85C \uD3B8\uC785\uC2DC\uCF1C \uBC84\uB9BC\uC73C\uB85C\uC368 \uB2E4\uC218 \uB300\uC911, \uD2B9\uD788 \uB0A8\uC131\uB4E4\uB85C \uD558\uC5EC\uAE08 \uBC94\uC8C4\uC790 \uC9D1\uB2E8\uACFC \uC790\uC2E0\uB4E4\uC744 \uC644\uC804\uD788 \uBD84\uB9AC\uC2DC\uD0AC \uC218 \uC788\uC73C\uBA70,",
