  "text" : "\uD53C\uD574\uC790\uC758 \uC21C\uC9C4\uBB34\uAD6C\uD55C \uB098\uC57D\uD568\uACFC \uADF9\uBA85\uD558\uAC8C \uB300\uBE44\uB418\uB294 \uBC94\uC8C4\uC778\uC758 \uC794\uD639\uD55C \uD3ED\uB825\uD589\uC704\uAC00 '\uD544\uC694 \uC774\uC0C1\uC73C\uB85C \uBC18\uBCF5\uD574\uC11C \uBB18\uC0AC'\uB418\uAC8C \uB41C\uB2E4. \uC774\uB807\uAC8C \uC794\uC778\uD558\uACE0 \uB450\uB835\uAE30\uAE4C\uC9C0 \uD55C \uBC94\uC8C4\uD589\uC704\uC758 \uC0C1\uC138\uD55C \uBCF4\uB3C4\uB294 \uC77C\uC885\uC758 '\uB3C4\uB355\uC801 \uACF5\uD3EC (moral panic)'\uB97C \uC720\uBC1C\uD558\uAC8C \uB418\uB294\uB370,",
